sys_variable_value.value:
(function execute(inputs, outputs) {
// we need to take out the base url and only send the resource path
var inputURL = inputs.url;
var url = inputURL.match(/^https?:\/\/[^\/]+(\/.*)$/);
outputs.url = url[1];
})(inputs, outputs);

